<tr>
<th>特長</th>
<td>
<p class="wb">●鉄筋２４畳まで木造１７畳まで対応です。<br />
●ヒーター切れのない電子点火タイプです。<br />
●芯長持ち機能『でるでる芯』付です。<br>
●ニオイセーブ消火機能。<br>
●対震自動消火装置機能があり、地震時でも安心です。<br>
●油漏れしにくい火災予防機能<br>
●タンクキャップは、「楽ロック」。手ごたえと音で確実にロック。特許です。<br>
●給油時消火機能付き。<br>

</p>
</td>
<th>仕様</th>
<td>
<p class="wb">●乾電池別売：単2×4本必要<br />
●タンク容量(L):6.3<br />
●暖房出力(kW/h):6.66<br />
●色:ホワイト<br />
●幅(mm):482<br />
●奥行(mm):482<br />
●高さ(mm):583</p>
</td>
</tr>
